                <RankNewsList />
                <AdArea />
                <RankNewsList />
                <AdArea />
            </div>
        )
    }
}

const mapDispatchToProps = dispatch =>
    bindActionCreators({  }, dispatch)

export default connect(
    null,
    mapDispatchToProps
)(Top50)
